import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <nav>
            <Link to="/dashboard">Dashboard</Link>
            <Link to="/habit-log">Habit Log</Link>
            <Link to="/profile">Profile</Link>
        </nav>
    );
}

export default Navbar;
